import React, { useState, useEffect } from 'react';
import { Card } from 'react-bootstrap';

const getImages = async () => {
   const res = await fetch('https://api.nasa.gov/planetary/apod?api_key=rpf2PXcZhgOIA7Tjek38tFq5HDa7a5dsUgDiuVo1&count=5');
   const data = await res.json();
   return data;
}

function HomePage() {
    const [photos, setPhotos] = useState([]);

    const handleImages = () => {
        getImages().then((photos) => {
            setPhotos((curr) => [...curr, ...photos]);
        });
    };

    useEffect(() => {
        handleImages();
    }, []);

    return(
        <><h2>Spaceagram</h2><ul>
            {photos.map(photo => (<Card key={photo.id}>{photo.title}
                <Card.Img variant="top" src="holder.js/100px180" />
            {photo.img}</Card>))}
        </ul></>



    );

}

export default HomePage
